import { useState, useContext } from "react";
import { useNavigate, Link } from "react-router-dom";
import { AuthContext } from "../context/AuthContext";

export default function Login() {
  const { login } = useContext(AuthContext);
  const navigate = useNavigate();
  const [form, setForm] = useState({ email: "", password: "" });
  const [error, setError] = useState("");
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setForm((previous) => ({ ...previous, [name]: value }));
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    setError("");
    setIsSubmitting(true);

    try {
      const user = await login(form.email.trim(), form.password);

      if (user?.role === "farmer") {
        navigate("/farmer-home");
      } else if (user?.role === "dealer") {
        navigate("/home");
      } else {
        navigate("/");
      }
    } catch (submitError) {
      setError("We couldn't sign you in with those details.");
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div className="auth-bg">
      <div className="auth-shell">
        <section className="auth-info-panel">
          <span className="auth-badge">AgroVision</span>
          <h1>Grow smarter with real-time crop intelligence</h1>
          <p>
            Access your personalised dashboard to manage crop yields, marketplace deals,
            and farmer-dealer conversations in one place.
          </p>
          <ul className="auth-highlights">
            <li>Secure access for farmers and dealers</li>
            <li>Track requests and offers effortlessly</li>
            <li>Stay updated with instant notifications</li>
          </ul>
        </section>

        <div className="auth-form-panel">
          <div className="auth-form-header">
            <h2>Sign in to your account</h2>
            <p>Welcome back! Please enter your credentials to continue.</p>
          </div>

          {error && <div className="error-box">{error}</div>}

          <form onSubmit={handleSubmit} className="auth-form" noValidate>
            <label htmlFor="email">Email address</label>
            <input
              id="email"
              type="email"
              name="email"
              placeholder="name@example.com"
              autoComplete="email"
              value={form.email}
              onChange={handleChange}
              required
            />

            <label htmlFor="password">Password</label>
            <input
              id="password"
              type="password"
              name="password"
              placeholder="Enter your password"
              autoComplete="current-password"
              value={form.password}
              onChange={handleChange}
              required
            />

            <div className="auth-form-utilities">
              <label className="auth-remember">
                <input type="checkbox" name="remember" /> Remember me
              </label>
              <a className="auth-help-link" href="mailto:support@agrovision.com">
                Need help?
              </a>
            </div>

            <button type="submit" disabled={isSubmitting}>
              {isSubmitting ? "Signing in..." : "Sign In"}
            </button>
          </form>

          <div className="auth-form-footer">
            <span>New to AgroVision?</span>
            <Link to="/register">Create an account</Link>
          </div>
        </div>
      </div>
    </div>
  );
}
